import Vue from "vue";
import TodoList from "./TodoList.vue";

document.addEventListener('DOMContentLoaded', () => {
  const el = document.getElementById('todo-list')
  const app = new Vue({
    el,
    render: h => h(TodoList, {
      props: {
        user_id: el.dataset.user_id
      }
    })
  })

});
